import axios from 'axios';

const KEY = 'AIzaSyAydF2UPyJ2xoTUh3Y77OhtX5bi8GNARVc';

export default axios.create({
  baseURL: 'https://www.googleapis.com/youtube/v3',
  params: {
    KEY: KEY,
    type: 'video',
    part: 'snippet',
    maxResults: 5,
  },
});
